  false,\n\t\"url\": null,\n\t\"notes\": \"World Ocean Atlas 2005 (WOA05) is a set
  of objectively analyzed (1u00b0 grid) climatological fields of in situ temperature,
  salinity, dissolved oxygen, Apparent Oxygen Utilization (AOU), percent oxygen saturation,
  phosphate, silicate, and nitrate at standard depth levels for annual, seasonal,
  and monthly compositing periods for the World Ocean. It also includes associated
  statistical fields of observed oceanographic profile data interpolated to standard
  depth levels on both 1u00b0 and 5u00b0 grids.\",\n\t\"license_title\": null,\n\t\"extras\":
